import React from "react";

function HomeDash() {
  return (
    <div className="flex min-h-screen ">
      <div className="bg-red-400 w-[20%]">
        <div className="flex ml-8">
          <div className="flex items-center gap-3">
            <img classname="w-[70%]" src="/images/friends.svg" alt="" />
            <p className="text-lg font-semibold">Friends</p>
          </div>
        </div>
      </div>
      <div className="bg-parent-400 w-[50%]">chat</div>
      <div className="bg-green-400 w-[30%]">activenow</div>
    </div>
  );
}

export default HomeDash;
